    "contracts/BundlePayments.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "hardhat/console.sol";
import "./access/Ownable.sol";
import "./access/Ownable.sol";
import "./utils/token/SafeERC20.sol";
import "./interfaces/IERC20.sol";


contract BundlePayments is Ownable {
    using SafeERC20 for IERC20;

    uint256 public totalPayments = 0;
    uint16 public bundleSize = 150;
    address[] public allowedAddresses;
    address[] public allowedTokens;
    mapping(bytes32 => mapping(uint16 => bool)) public paidPayments;

    event BundlePaid(uint256 indexed _totalPayments, bytes32 indexed _paymentId, uint16 indexed _bunchIndex, address _paymentToken, address[] _addresses, uint256[] _amounts);

    function setBundleSize(uint16 _bundleSize) external onlyOwner {
        bundleSize = _bundleSize;
    }

    function addAllowedAddress(address _address) external onlyOwner {
        (bool found,) = indexOfAllowedAddress(_address);
        require(!found, 'Address already added');
        allowedAddresses.push(_address);
    }

    function removeAllowedAddress(address _address) external onlyOwner {
        (bool found, uint256 index) = indexOfAllowedAddress(_address);
        require(found, 'Address not found');
        if (allowedAddresses.length > 1) {
            allowedAddresses[index] = allowedAddresses[allowedAddresses.length - 1];
        }
        allowedAddresses.pop();
    }

    function addAllowedToken(address _token) external onlyOwner {
        (bool found,) = indexOfAllowedTokens(_token);
        require(!found, 'Token already added');
        allowedTokens.push(_token);
    }

    function removeAllowedToken(address _token) external onlyOwner {
        (bool found, uint256 index) = indexOfAllowedTokens(_token);
        require(found, 'Token not found');
        if (allowedTokens.length > 1) {
            allowedTokens[index] = allowedTokens[allowedTokens.length - 1];
        }
        allowedTokens.pop();
    }

    function bundlePayments(
        bytes32 _paymentId,
        uint16 _bunchIndex,
        address _paymentToken,
        address[] memory _addresses,
        uint256[] memory _amounts
    ) public onlyAllowedAddress {
        uint256 total = 0;
        require(_addresses.length <= bundleSize, 'Maximum allowed bundle payments, check bundleSize variable');
        require(!paidPayments[_paymentId][_bunchIndex], 'Payments for current payments have already been launched earlier');
        (bool found,) = indexOfAllowedTokens(_paymentToken);
        require(found, 'Not allowed token');
        IERC20 erc20token = IERC20(_paymentToken);
        uint16 i = 0;
        require(erc20token.allowance(msg.sender, address(this)) > 0);
        for (i; i < _addresses.length; i++) {
            erc20token.transferFrom(msg.sender, _addresses[i], _amounts[i]);
            total += _amounts[i];
        }
        totalPayments ++;
        paidPayments[_paymentId][_bunchIndex] = true;
        emit BundlePaid(totalPayments, _paymentId, _bunchIndex, _paymentToken, _addresses, _amounts);
    }

    function indexOfAllowedTokens(address _token) public view returns (bool found, uint256 index) {
        for (uint256 i = 0; i < allowedTokens.length; i++) {
            if (allowedTokens[i] == _token) {
                return (true, i);
            }
        }
        return (false, 0);
    }

    function getAllowedAddress() public view returns (address[] memory addresses) {
        return allowedAddresses;
    }

    function getAllowedTokens() public view returns (address[] memory tokens) {
        return allowedTokens;
    }

    function indexOfAllowedAddress(address _address) public view returns (bool found, uint256 index) {
        for (uint256 i = 0; i < allowedAddresses.length; i++) {
            if (allowedAddresses[i] == _address) {
                return (true, i);
            }
        }
        return (false, 0);
    }

    modifier onlyAllowedAddress() {
        (bool found, uint256 index) = indexOfAllowedAddress(_msgSender());
        require(found, "Caller is not allowed address");
        _;
    }
}
"
